import React from "react";
import { Navigate } from "react-router-dom";
import { useAuth } from "./firebase.js"; 

const ProtectedRoute = ({ children }) => {
  const { auth } = useAuth(); 

  return auth ? children : <Navigate to="/login" replace />;
};

export default ProtectedRoute;
